import CreateComponent from "./Component/CreateComponent";


function App() {
  const User=[{
    name:"sachin",
    age:20
 }]
 const addUserHandler=()=>{
    console.log(User)
 }
  return (
    <div>
      <div>
      <FormComponent user={User} onAdd={addUserHandler}></FormComponent>
      </div>
      <div>
        <CreateComponent user={User}  ></CreateComponent>
      </div>
    </div>
  );
}

export default App;
